import { Menu, Container, Image, Icon } from 'semantic-ui-react';
import Link from 'next/link';


function Header() {
  return (
    <Menu fluid id="menu" inverted>
      <container text>
        <Link href="/">
          <Menu.Item header>
            <image size="mini" src="/static/logo.svg" style={{ magrinRight: '1em' }}></image>
          </Menu.Item>
          KaolaKickball
        </Link> 

      </container>
    </Menu>
  )
}

export default Header;
